import numpy

input = ""

for i in range(0, len(input)):
	sop = input[i:i + 4]
	if len(sop) != 4:
		continue

	if len(numpy.unique(input[i:i + 4])) == 4:
		print(i + 4)
		print(sop)
		break

for i in range(0, len(input)):
	som = input[i:i + 14]
	if len(som) != 14:
		continue

	if len(numpy.unique(input[i:i + 14])) == 14:
		print(i + 14)
		print(som)
		break
